VALUES ('3254565471233', '10 Nuggets de poulet', 'Produit à base de viande de poulet traitée en salaison 66,7% : viande de poulet 42,6%, eau, amidon modifié de pomme de terre, fécule de manioc, fibres de blé (contient _gluten_), sel; stabilisants : triphosphates, polyphosphates, diphosphates; arômes naturels. Pâte à beignet frite 33,3% : farines (blé, seigle et riz) (contient _gluten_), eau, huile de tournesol, amidon et amidon modifié de blé (contient _gluten_), sel, _gluten_ de blé; poudres à lever : diphosphates, carbonates de sodium; dextrose, poudre de lactosérum (contient _Lait_), sucre et sucre caramélisé, extrait de chicorée; émulsifiant : mono et diglycérides d\'acide gras; arômes, correcteur d\'acidité : acide acétique, levure.', 'https://static.openfoodfacts.org/images/products/325/456/547/1233/front_fr.11.400.jpg', '11', '1.1', '16', '3.2', '', '9.5', '1.5', '0.590551181102362', '', '0');

