VALUES ('3254565471301', '2 cordons bleus de dinde', 'VIANDE DE DINDE TRAITÉE EN SALAISON (50 %) [viande de dinde (80 %), eau, dextrose de pois, sel, antioxydant : citrate de sodium, arôme]. PANURE FRITE (25 %) [chapelure (farine de blé, sel, levure, épices : curcuma, paprika), huile de tournesol, eau, farine de blé, amidon de blé, gluten de blé, sel, conservateur : sorbate de potassium]. JAMBON DE DINDE GOÛT FUMÉ (15 %) [viande de dinde (70 %), eau, dextrose, protéines de blé, sel, stabilisants (tripolyphosphates de sodium, dipolyphosphates de sodium), arômes : dont arôme de fumée (contient blé), conservateur : nitrite de sodium]. FROMAGE FONDU (10 %) [fromages (60 %), eau, protéines de lait, beurre, poudre de lait écrémé, sels de fonte, citrate de sodium, dipolyphosphates, polyphosphates de sodium].', 'https://static.openfoodfacts.org/images/products/325/456/547/1301/front_fr.9.400.jpg', '9', '2.5', '13', '3', '1.5', '14', '1.5', '0.590551181102362', '', '0');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
